import { useState, useEffect } from 'react'

function AddUsers() {
    const [users, setUsers] = useState({})
    const fetchUsers = () => (
        fetch('/users').then(res => res.json()).then(data => setUsers(data))
    )
    useEffect(() => {fetchUsers()}, [])
    // fetchUsers()
    // console.log(users)
    return (
        <h1> Add Users </h1>
    )
}

export default AddUsers
